    import React from 'react'

    const Item = ({ items }) => {
      return (
        <div>
          <center><h1>Item List</h1></center>
          {items.map((item) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{item.Topic}</h5>
               
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Contacts
